-- Criação da tabela Hotel
CREATE TABLE Hotel (
    id INT,
    CNPJ VARCHAR(18),
    Nome VARCHAR(255),
    Tipo VARCHAR(45),
    Email VARCHAR(150),
    Telefone VARCHAR(16),
    EnderecoFoto VARCHAR(255),
    Site VARCHAR(255),
    Acessibilidade TINYINT(1),
    Endereco_id INT
);

